              unique look that communicates the right message to <br />
              the target audience. Brand management, Brand
              <br /> Identity Design, Logo Design, Art Direction,
              <br /> Brand consulting are some of the Branding <br />
              services that we do.{" "}
            </div>
          </div>
          <div className="sec3-child">kk</div>
          <div className="sec3-child">kk</div>
          <div className="sec3-child">kk</div>
        </div>
      </div>
    </div>
  );
}

export default DesignProcess;
